window.bookSummaryJSON = "<p><b>Something is here. Something otherworldly, something alien, and its intentions are far from amicable.</b></p> <p>Families are going missing in the city, and investigative operative Carmella Hunter has been tasked to find them. With the public eye on her every move, Carmella must work against a ticking clock to locate the missing humans. When the evidence begins to point to an entirely alien and sinister plot, the government agency Carmella works for is forced to change strategy. Now, Carmella and her friends must go undercover in the hopes of becoming the next victims. But will the kidnapper take the bait? And if he does, will Carmella and her friends make it out alive?</p>"; 
